import { Card, CardContent, CardDescription, CardHeader, CardTitle } from "@/components/ui/card";
import { APP_NAME } from "@/lib/constants";
import { Metadata } from "next";
import Image from "next/image";
import Link from "next/link";
import CredentialSigninForm from "./credentials-signin-form";
import { auth } from "@/auth";
import {redirect} from 'next/navigation'

export const metadata : Metadata = {
  title: "Sign In",
};

export default async function SignInPage(props :{
  searchParams : Promise<{
    callbackUrl:string
  }>
}) {

  const { callbackUrl }= await props.searchParams

 
 
  const session = await auth();
  
  if(session){
   return redirect(callbackUrl || '/')
  }
  
  

  return (
    <div className='w-full max-w-md mx-auto -mt-20 '>
      <Card className="border-none card">
        <CardHeader className='space-y-4 card-header'>
        <Link href='/' className='flex-center'>
          
          
          <svg width="300" height="300" viewBox="0 0 500 500" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
<rect width="500" height="500" fill="url(#pattern0_19_4)"/>
<defs>
<pattern id="pattern0_19_4" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image0_19_4" transform="scale(0.002)"/>
</pattern>
<image id="image0_19_4" width="500" height="500" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
</defs>
</svg>
</Link>
          <CardTitle className="text-center ">Sign In</CardTitle>
          <CardDescription className="text-center">
            Sign in to your account
          </CardDescription>
        </CardHeader>
        <CardContent className="space-y-4">
            <CredentialSigninForm />
            <div className="text-sm text-center text-muted-foreground">
          Don&apos;t have an account?{' '}
          <Link href='/sign-up' target="_self" className="link justify-center items-center mt-3">
          Sign Up
          </Link>
        </div>
        </CardContent>
        
      </Card>
    </div>
  );
}
